import "./ToolBar.css";
import { DatePicker } from 'antd';


const { RangePicker } = DatePicker;

function ToolBar() {
  const rangeOnChange = (rangeValue) => {
    console.log(rangeValue[0], rangeValue[1])
  }

  return (
    <div className="toolBar">
      <RangePicker onChange={rangeOnChange} />
    </div>
  )
}

export default ToolBar;
